Ext.data.JsonP['Studio_Troubleshooting']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Studio Troubleshooting</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-30083281\" class=\"content\">\n                        <h1>Studio Troubleshooting</h1>\n    <div class=\"section section-2 \" id=\"src-30083281_StudioTroubleshooting-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Studio_Troubleshooting-section-src-30083281_StudioTroubleshooting-Overview\">Overview</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Studio_Troubleshooting-section-src-30083281_StudioTroubleshooting-SubmittingaBug\">Submitting a Bug</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Studio_Troubleshooting-section-src-30083281_StudioTroubleshooting-CommonIssues\">Common Issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Studio_Troubleshooting-section-src-30083281_safe-id-U3R1ZGlvVHJvdWJsZXNob290aW5nLVdlYlRvb2xzRmVhdHVyZVJlcXVlc3RzL0J1Z3M\">Web Tools Feature Requests/Bugs</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Studio_Troubleshooting-section-src-30083281_safe-id-U3R1ZGlvVHJvdWJsZXNob290aW5nLVRpdGFuaXVtVG9vbHNGZWF0dXJlUmVxdWVzdHMvQnVncw\">Titanium Tools Feature Requests/Bugs</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-30083281_StudioTroubleshooting-RelatedTopics\">\n        <h2 class=\"heading \"><span>Related Topics</span></h2>\n<ul class=\"childpages-macro \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Accessing_the_Log_File\">Accessing the Log File</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Crashes_and_Freezes\">Crashes and Freezes</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Debugging_Studio\">Debugging Studio</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Determining_Your_Studio_Configuration\">Determining Your Studio Configuration</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_Building_Titanium_Projects\">Errors Building Titanium Projects</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_Logging_In_to_Studio\">Errors Logging In to Studio</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_While_Starting_Studio\">Errors While Starting Studio</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_While_Updating\">Errors While Updating</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_While_Publishing\">Errors While Publishing</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Reporting_Bugs_or_Requesting_Features\">Reporting Bugs or Requesting Features</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Problems_with_WST_and_PDT\">Problems with WST and PDT</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_Configuring_Platforms_Inside_Studio\">Errors Configuring Platforms Inside Studio</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Performance_Issues\">Performance Issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Errors_with_360_services\">Errors with 360 services</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-30083281_StudioTroubleshooting-Overview\">\n        <h2 class=\"heading \"><span>Overview</span></h2>\n    <p>Bugs and feature requests need to be filed in two different locations, depending on if the issue relates to web development tools, or Titanium specific functionality.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-30083281_StudioTroubleshooting-SubmittingaBug\">\n        <h2 class=\"heading \"><span>Submitting a Bug</span></h2>\n    <p>Refer to <a class=\"document-link \" href=\"#!/guide/Reporting_Bugs_or_Requesting_Features\">Reporting Bugs or Requesting Features</a> for more information. Check JIRA first as the issue may already have been reported with a fix or workaround.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-30083281_StudioTroubleshooting-CommonIssues\">\n        <h2 class=\"heading \"><span>Common Issues</span></h2>\n    <p>Some common troubleshooting requests and diagnostic solutions.    </p>\n    <p><a class=\"document-link \" href=\"#!/guide/Errors_Building_Titanium_Projects\">Trouble Building Titanium Projects</a>    </p>\n    <p><a class=\"document-link \" href=\"#!/guide/Errors_While_Updating\">Trouble Updating Studio</a>    </p>\n    <p><a class=\"document-link \" href=\"#!/guide/Errors_Logging_In_to_Studio\">Trouble Logging In</a>    </p>\n    <p><a class=\"document-link \" href=\"#!/guide/Problems_with_WST_and_PDT\">Trouble Using WST/PDT With The Studio</a>    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-30083281_safe-id-U3R1ZGlvVHJvdWJsZXNob290aW5nLVdlYlRvb2xzRmVhdHVyZVJlcXVlc3RzL0J1Z3M\">\n        <h2 class=\"heading \"><span>Web Tools Feature Requests/Bugs</span></h2>\n    <p>Please file a report at <a class=\"external-link external-link\" href=\"http://jira.appcelerator.org/browse/APSTUD\" target=\"_blank\">http://jira.appcelerator.org/browse/APSTUD</a>. Follow the <a class=\"document-link \" href=\"#!/guide/Reporting_Bugs_or_Requesting_Features\">checklist</a> when creating a bug report.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-30083281_safe-id-U3R1ZGlvVHJvdWJsZXNob290aW5nLVRpdGFuaXVtVG9vbHNGZWF0dXJlUmVxdWVzdHMvQnVncw\">\n        <h2 class=\"heading \"><span>Titanium Tools Feature Requests/Bugs</span></h2>\n    <p>Please file a report at <a class=\"external-link external-link\" href=\"http://jira.appcelerator.org/browse/TC\" target=\"_blank\">http://jira.appcelerator.org/browse/TC</a>. Follow the <a class=\"document-link \" href=\"#!/guide/Reporting_Bugs_or_Requesting_Features\">checklist</a> when creating a bug report.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083281\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Studio Troubleshooting"});